import React from 'react';
import aboutData from '../data/about'

function About() {
  return (
    <div>
      <h1>About ProRide</h1>
      <p>Pro-Ride Coaching was set up in 2014 by ex-teacher and former Olympic cyclist, Phil Bateman in response to the growing popularity of cycling thanks to the visit of the Tour de France and the success of a growing number of British cyclists such as Chris Froome, Mark Cavendish and Bradley Wiggins.</p>
      <p>Aimed at giving school children a taste of bike racing and access to the sport rather than a road safety course, the program was a huge success with both children and staff and by the end of the year over 3,000 children had taken part in a Pro-Ride session.</p>
    </div>
  );
}

export default About;
